import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './components/PrivateRoute';
import Layout from './components/Layout';

// --- REAL PAGE IMPORTS ---
import Home from './pages/Home';
import About from './pages/About';
import Cars from './pages/Cars';
import Booking from './pages/Booking';
import UserDashboard from './pages/UserDashboard'; // <--- NEW: Real Dashboard

// --- PLACEHOLDERS ---
// (We will replace these with real files in the next steps)
const Login = () => <div className="container" style={{ padding: '2rem' }}><h1>Login Page (Coming Soon)</h1></div>;
const Register = () => <div className="container" style={{ padding: '2rem' }}><h1>Register Page (Coming Soon)</h1></div>;
const AdminDashboard = () => <div className="container" style={{ padding: '2rem' }}><h1>Admin Dashboard (Coming Soon)</h1></div>;
const NotFound = () => <div className="container" style={{ padding: '2rem' }}><h1>404 - Page Not Found</h1></div>;

function App() {
  return (
    <AuthProvider>
      <Router>
        <Layout>
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/cars" element={<Cars />} />
            <Route path="/booking/:id" element={<Booking />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

            {/* Protected User Route */}
            <Route 
              path="/user/*" 
              element={
                <PrivateRoute roleRequired="user">
                  <UserDashboard /> {/* Now points to the real file */}
                </PrivateRoute>
              } 
            />

            {/* Protected Admin Route */}
            <Route 
              path="/admin/*" 
              element={
                <PrivateRoute roleRequired="admin">
                  <AdminDashboard />
                </PrivateRoute>
              } 
            />

            {/* Catch All */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </Layout>
      </Router>
    </AuthProvider>
  );
}

export default App;
